import React from "react";
import "../home.css";
import p1 from "../assets/1.jpg";
import p2 from "../assets/2.jpg";
import p3 from "../assets/3.jpg";
import p4 from "../assets/4.jpg";
import Header from "./header";




function Home() {



    return(
        <div className="main">
            <Header/>
            {/* <div className="main"></div> */}

            <div><h1 className="hero">Empowering Credit Access</h1></div>

            <div className="services">
                <div className="s">
                    <div className="s1pic"><img src={1}></img> </div>
                    <div className="caption1">
                        <p></p>
                    </div>
                <div className="s">
                    <div className="s2pic"><img src={2}></img> </div>
                    <div className="caption2">
                        <p></p>
                    </div>
                </div>
                <div className="s">
                    <div className="s3pic"><img src={3}></img> </div>
                    <div className="caption3">
                        <p></p>
                    </div>
                </div>

                    
                </div>
            </div>

        </div>
    );
    
}
export default Home;
